import React, { useEffect, useState } from "react";
import * as api from "../api/endpoint";
import "./DoctorDashboard.css";

const DoctorDashboard = () => {
  const [dossiers, setDossiers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    loadDossiers();
  }, []);

  const loadDossiers = async () => {
    setLoading(true);
    setError("");
    try {
      // Récupérer les dossiers du médecin connecté
      const data = await api.getData("/dossier/mes-dossiers");
      setDossiers(data);
    } catch (err) {
      console.error("Erreur lors du chargement des dossiers:", err);
      setError(err.message || "Erreur lors du chargement des dossiers");
    } finally {
      setLoading(false);
    }
  };

  const viewDossier = (dossier) => {
    if (!dossier || !dossier.patientId) {
      alert("Aucun dossier disponible pour ce patient.");
      return;
    }

    const patient = dossier.patientId;
    alert(
      `Dossier de ${patient.fullName}:\n` +
      `Email: ${patient.email}\n` +
      `Date de naissance: ${patient.date_of_birth ? new Date(patient.date_of_birth).toLocaleDateString() : "Non renseignée"}\n` +
      `Sexe: ${patient.sexe || "Non renseigné"}\n\n` +
      `Résumé médical: ${dossier.resumeMedical || "Non renseigné"}\n` +
      `Groupe sanguin: ${dossier.groupeSanguin || "Non renseigné"}\n` +
      `Antécédents: ${dossier.antecedents?.join(", ") || "Non renseigné"}\n` +
      `Allergies: ${dossier.allergies?.join(", ") || "Non renseigné"}\n` +
      `Contact urgence: ${dossier.contactUrgence ? `${dossier.contactUrgence.nom} (${dossier.contactUrgence.telephone})` : "Non renseigné"}`
    );
  };

  return (
    <div className="doctor-interface">
      <header className="doctor-header">
        <h1>Dashboard Médecin</h1>
      </header>

      {loading && <p>Chargement des dossiers...</p>}
      {error && <p style={{ color: "red" }}>{error}</p>}

      {!loading && !error && (
        <div className="dossiers-list">
          {dossiers.length === 0 ? (
            <p>Aucun dossier enregistré pour vos patients.</p>
          ) : (
            <table>
              <thead>
                <tr>
                  <th>Nom patient</th>
                  <th>Email</th>
                  <th>Date de naissance</th>
                  <th>Sexe</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {dossiers.map((dossier) => (
                  <tr key={dossier._id}>
                    <td>{dossier.patientId?.fullName || "Non renseigné"}</td>
                    <td>{dossier.patientId?.email || "Non renseigné"}</td>
                    <td>{dossier.patientId?.date_of_birth ? new Date(dossier.patientId.date_of_birth).toLocaleDateString() : "Non renseignée"}</td>
                    <td>{dossier.patientId?.sexe || "Non renseigné"}</td>
                    <td>
                      <button onClick={() => viewDossier(dossier)}>Voir Dossier</button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}
        </div>
      )}
    </div>
  );
};

export default DoctorDashboard;
